# 3. Longest Substring Without Repeating Characters
# https://leetcode.com/problems/longest-substring-without-repeating-characters/
# 16:25 ~ 16:40(포기)


class Solution:
    def hasRepeatingCharacter(self, sub: str) -> bool:
        h = {}
        for s in sub:
            if s in h:
                return True
            h[s] = s
        return False

    def lengthOfLongestSubstring(self, s: str) -> int:
        result = 0
        for i in range(0, len(s)):
            for j in range(i + 1, len(s) + 1):
                if j - i <= result:
                    continue

                sub = s[i:j]
                if self.hasRepeatingCharacter(sub):
                    break
                result = j - i

        return result


